import { createMuiTheme } from '@material-ui/core/styles';

const theme = createMuiTheme({
  palette: {
    primary: {
      light: '#4f5b62',
      main: '#263238',
      dark: '#000a12',
      contrastText: '#fff',
    },
    secondary: {
      light: '#ffaf4c',
      main: '#f47e17',
      dark: '#bb5000',
      contrastText: '#000',
    },
  },
});

export default theme
